import React, { Component, Fragment } from "react";
import { Container, Row, Col } from "react-bootstrap";
import logo1 from '../../asset/image/1.png';
import logo2 from '../../asset/image/2.png';
import logo3 from '../../asset/image/3.jpg';
class Cources extends Component {
  render() {
    return (
      <Fragment>
        <Container className="text-center">
            <h1 className="serviceMainTitle">OUR COURCES</h1>
          <Row>
            <Col lg={6} md={12} sm={12}>
              <Row>
                <Col lg={6} md={6} sm={12}>
                    <img src={logo1} className="courceImage" />
                </Col>
                <Col lg={6} md={6} sm={12}>
                    <h5 className>Web Development</h5>
                    <p className="courseDes">A quick brown fox jumps over the lazy dog</p>
                    <a className="courseDetails" href="#">Details</a>
                </Col>
              </Row>
            </Col>
            <Col lg={6} md={12} sm={12}>
              <Row>
                <Col lg={6} md={6} sm={12}></Col>
                <Col lg={6} md={6} sm={12}></Col>
              </Row>
            </Col>
          </Row>
        </Container>
      </Fragment>
    );
  }
}

export default Cources;
